// 引入pinia
import { defineStore } from 'pinia';

// 参数一为容器 ID 必须唯一
export const userStore = defineStore('user', {
    state: () => {
        return {
            token: localStorage.getItem('token') || null,
            userInfo: {
                name: '默认用户',
                autograph: '这个人很懒，什么都没留下。',
                user_pic: 'data:image/jpeg;base64,',
                sex: '未知'
            },
        }
    },
    getters: {},
    actions: {
        upDataToken(token) {
            this.token = token
        },
        upDataUserInfo(userInfo) {
            this.userInfo = userInfo
        }
    }
})